import { Component } from 'react'
import { Row, Col } from 'antd';


class Add extends Component {

    constructor(props) {
        super(props)

    }

    render(h) {
        return (
            <div id={'addSection'}>
                <Row>
                    <Col span={8}>col-8</Col>
                    <Col span={8}>col-8</Col>
                </Row>
            </div>
        )
    }
}

export default Add;
